export default class LapRunners extends React.Component() {
  render() {
    const { runners, setRunners, resetRunners } = this.props;
    return (
      <div style={{ textAlign: "center" }}>
        <div>
          <span>Tracking </span>
          <span>
            {" "}
            <input type="number" />{" "}
          </span>
          <span> Runners</span>
        </div>

        {/* Buttons */}
        <div>
          {runners == null ? `null` : `not null`}
          <div>Start</div>
          <div>Reset</div>
        </div>
      </div>
    );
  }
}
